import React from 'react';

// Mock trip data
const mockTrips = [
  {
    trip_id: 1,
    trip_name: 'European Adventure',
    trip_type: 'Cultural',
    duration: 10,
    base_price: 1200.00,
    description: 'Explore iconic cities across Europe.'
  },
  {
    trip_id: 2,
    trip_name: 'Tropical Escape',
    trip_type: 'Relaxation',
    duration: 7,
    base_price: 950.00,
    description: 'Relax on sunny beaches with clear blue waters.'
  }
];

function HomePage() {
  return (
    <div className="container mt-4">
      <h2 className="mb-4">Available Trips</h2>
      <div className="row">
        {mockTrips.map((trip) => (
          <div key={trip.trip_id} className="col-md-4 mb-4">
            <div className="card h-100 shadow-sm">
              <div className="card-body">
                <h5 className="card-title text-primary">{trip.trip_name}</h5>
                <p className="card-text"><strong>Type:</strong> {trip.trip_type}</p>
                <p className="card-text"><strong>Duration:</strong> {trip.duration} days</p>
                <p className="card-text"><strong>Price:</strong> ${trip.base_price}</p>
                <p className="card-text">{trip.description}</p>
                <button className="btn btn-outline-primary">View Details</button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default HomePage;
